import React,{Component} from 'react';
import{Link} from 'react-router-dom';
import {Jumbotron,CO,Row,Col,Image,Button} from 'react-bootstrap';
import './Home.css';
export default class Home extends Component{
render(){
    return(
        <Grid>
            <Jumbotron>
                <h2>Welcome To MSM</h2>
                <p>Cover is a one-page template for building simple and beautiful home pages.<br></br>
                   Download, edit the text, and add your own fullscreen background photo to make it your own.</p>
            </Jumbotron>
            <Link to="/profile">
            <Button bsStyle="primary">Learn More</Button>
            </Link>
        </Grid>
    )
}
}
